import React from 'react';

function TableInf({ expense, currencyConverted, exchange }) {
  const { value, description, currency, method, tag } = expense;
  return (
    <>
      <tr>
        <td>
          {value}
        </td>
        <td>
          {description}
        </td>
        <td>
          {currency}
        </td>
        <td>
          {method}
        </td>
        <td>
          {tag}
        </td>
        <td>
          { exchange }
        </td>
        <td>
          { currencyConverted }
        </td>
        <td>
          BRL
        </td>
      </tr>
    </>
  );
}

export default TableInf;
